% Start up the DSS
if exist('DSSStartOK','var')==0
    [DSSStartOK, DSSObj, DSSText] = DSSStartup(cd);
end
DSSStartOK
% Check to see if the DSS started properly
if DSSStartOK
    DSSText.command = 'Clear';
    DSSText.command = 'New Circuit.Simple';
    DSSText.command = 'Edit Vsource.Source BasekV=115 pu=1.05  ISC3=3000  ISC1=2500';
    DSSText.command = 'New Transformer.TR1 Buses=[SourceBus, Sub_Bus] Conns=[Delta Wye] kVs= [115 12.47] kVAs=[20000 20000] XHL=10';
    DSSText.command = 'New Linecode.336ACSR R1=0.058 X1=.1206 R0=.1784 X0=.4047 C1=3.4 C0=1.6 Units=kft';
    DSSText.command = 'New Line.LINE1 Bus1=Sub_Bus Bus2=LoadBus Linecode=336ACSR Length=1 Units=Mi';
    DSSText.command = 'New Load.LOAD1 Bus1=LoadBus kV=12.47 kW=1000 PF=.95';
    DSSText.command = 'Solve';
    DSSText.command = 'show voltages';
    

    %select an element to examine
    DSSObj.ActiveCircuit.CktElements('LOAD1');
    DSSObj.ActiveCircuit.ActiveDSSElement.Properties('bus1').Val
    DSSObj.ActiveCircuit.ActiveDSSElement.Properties('pf').Val
    %modify the power factor explicitly 
    DSSText.command = 'edit load.LOAD1 pf=0.9';
    DSSObj.ActiveCircuit.ActiveDSSElement.Properties('pf').Val
    %modify the power factor generically 
    DSSText.command = 'batchedit load..* pf=0.92';
    DSSObj.ActiveCircuit.ActiveDSSElement.Properties('pf').Val
    
    %Add an PV system element
    DSSText.command = 'New PVsystem.PV_1 phases=3 conn=delta bus1=LoadBus kV=12.47 kVA=1200 Pmpp=1000 pf=1';
    DSSText.command = 'calcv';
    DSSText.command = 'set maxiter=100 maxcontroliter=100';
    DSSText.command = 'solve';
    
    
    %Modify the a PV size and observe the feeder voltage
    PVsize = 100:100:20001;
    for ii=1:length(PVsize)
        DSSText.command = ['edit PVsystem.PV_1 kVA=',num2str(PVsize(ii)*1.2),' pmpp=',num2str(PVsize(ii))];
        DSSText.command = 'solve mode=snap controlmode=static';
        DSSObj.ActiveCircuit.Buses('LoadBus');
        puvoltages = DSSObj.ActiveCircuit.ActiveBus.puVoltages;
        puvoltage(ii) = sqrt(puvoltages(1)^2+puvoltages(2)^2);
        DSSObj.ActiveCircuit.CktElements('Vsource.Source');
        powers = DSSObj.ActiveCircuit.ActiveElement.power;
        activepower(ii) = powers(1) + powers(3) + powers(5);
        reactivepower(ii) = powers(2) + powers(4) + powers(6);
    end
        
    figure(3)
    scatter(PVsize/1000,puvoltage,'filled')
    xlabel('PV Size (MW)')
    ylabel('Voltage (Vpu)')
    legend('Load Bus','location','southeast')

    figure(4)
    scatter(PVsize/1000,-activepower/1000,'filled'), hold on
    scatter(PVsize/1000,-reactivepower/1000,'filled'), hold off
    xlabel('PV Size (MW)')
    ylabel('Source Power (MW & Mvar)')
    legend('Active','Reactive','location','southwest')

    %Modify the a PV power factor
    for ii=1:length(PVsize)
        DSSText.command = ['edit PVsystem.PV_1 kVA=',num2str(PVsize(ii)*1.1),' pmpp=',num2str(PVsize(ii)),' pf=-0.99'];
        DSSText.command = 'solve mode=snap controlmode=static';
        DSSObj.ActiveCircuit.Buses('LoadBus');
        puvoltages = DSSObj.ActiveCircuit.ActiveBus.puVoltages;
        puvoltage(ii) = sqrt(puvoltages(1)^2+puvoltages(2)^2);
        DSSObj.ActiveCircuit.CktElements('Vsource.Source');
        powers = DSSObj.ActiveCircuit.ActiveElement.power;
        activepower(ii) = powers(1) + powers(3) + powers(5);
        reactivepower(ii) = powers(2) + powers(4) + powers(6);
    end
    figure(5)
